import React from 'react';
import Axios from 'axios';

import './App.css';

class App extends React.Component {

  state = {
    coords: {
      latitude: 0,
      longitude: 0
    }
  }

  componentDidMount() {
    if (navigator.geolocation) {
      navigator.geolocation.getCurrentPosition((position) => {
        let newCoords = {
          latitude: position.coords.latitude,
          longitude: position.coords.longitude,
        }
        this.setState({ coords: newCoords })
        console.log(this.state.coords)
        //Api Call
        http://api.openweathermap.org/data/2.5/weather?lat=19.95&lon=86.18&appid=d3856252805c106a89495a655d00f5da
        Axios.get(`https://api.openweathermap.org/data/2.5/onecall?lat=${this.state.coords.latitude}&lon=${this.state.coords.longitude}&appid=d3856252805c106a89495a655d00f5da`).then(res => {
          console.log(res)
        })
      })
    }
    else {
      console.log('Not supported')
    }
  }

  render() {
    return (
      <div className="App">

      </div>
    );
  }
}

export default App;
